import React from 'react';
import Card from '@material-ui/core/Card';
const creditCard = function(){

    const styles = {
        card: {
          minWidth: 275,
        },
        bullet: {
          display: 'inline-block',
          margin: '0 2px',
          transform: 'scale(0.8)',
        },
        title: {
          fontSize: 14,
        },
        pos: {
          marginBottom: 12,
        },
      };

    return(
        <Card style={styles}/>

    )
}

export default creditCard;
